import React from 'react';
import {Row, Col } from 'react-bootstrap';

export default function Albums(props) {
    return (
            <Row style={{alignItems: 'center'}}>
                <Col>{props.musicItem.lyric}</Col>

                <Col>
                    <Row>
                        <Col>
                            <img style={{height:'100vh'}} src={props.musicItem.albumReq}/>
                        </Col>
                    </Row>
                </Col>

                <Col>{props.musicItem.details}</Col>
            </Row>
    )
}
